import "./App.css";
import Form from "./components/Form/Form";
import Video from "./components/Video/Video";
import { videos } from './data.js'
export default function App(params) {
  return (
    <>
      <Form />
      <div className="row">
        <Video {...videos[0]} />
        <Video {...videos[1]} />
      </div>
    </>
  );
}
